import React from "react";
import ReactDOM from "react-dom";
import Card from "./Card";
import "./index.css";
import { SeriesData } from './Series';

ReactDOM.render(
  <>
    <h1>LIST OF TOP 5 NETFLIX SERIES</h1>
    <Card
      imgsrc={SeriesData[0].imgsrc}
      title={SeriesData[0].title}
      series={SeriesData[0].series}
      link={SeriesData[0].link}
    />
    <Card
      imgsrc={SeriesData[1].imgsrc}
      title={SeriesData[1].title}
      series={SeriesData[1].series}
      link={SeriesData[1].link}
    />
    <Card
      imgsrc={SeriesData[2].imgsrc}
      title={SeriesData[2].title}
      series={SeriesData[2].series}
      link={SeriesData[2].link}
    />
    <Card
      imgsrc="https://occ-0-4608-2164.1.nflxso.net/dnm/api/v6/X194eJsgWBDE2aQbaNdmCXGUP-Y/AAAABR7bSUQIdzkIHqtiYywst4qtxMAiJtdFhdeiww83-GPQbuTfI-FPPC51btznrPJffHwVB8_-Vwjs83w5lZMA112WdHxM3splwaJxBeSiZvMEL8pvq2laZEUtUkRv.jpg?r=518"
      title="A Netflix Original Series"
      series="THE CHRISTMAS CHRONICLES"
      link="https://www.netflix.com/in/title/80199682"
    />
    <Card
      imgsrc="https://occ-0-4608-2164.1.nflxso.net/dnm/api/v6/X194eJsgWBDE2aQbaNdmCXGUP-Y/AAAABQkk8X-c2ozb2XVf4tHjWR9-63Xy9YuOqH_W3pgaxk-vfLHDWT3rOrQGdyhmRs6M83a-xj-fGW9P1mZNq_mu7cr2LKpasl_r3pNbx3oX7E8venPfHbWmLdJkJuJy.jpg?r=c27"
      title="A Netflix Original Series"
      series="WISH DRAGON"
      link="https://www.netflix.com/in/title/81153694J"
    />
  </>,
  document.getElementById("root")
);
